O Aplicativo da Zelle oferece diversas funcionalidades desenvolvidas especialmente para facilitar a vida do Associado. O aplicativo permite que o Associado faça diversas solicitações e serviços instantâneos, como:

Convidar um amigo;
Realizar uma Adesão Online ou pedido de cotação.
Conhecer a História da Zelle;
Veja nossos Stories.
Ficar por dentro das Vantagens e benefícios;
Receber notícias de última hora;
Encontrar a base mais próxima;

Ver seus boletos digitais.
Conhecer e avaliar as oficinas credenciadas;
Acionar assistência 24h;
Comunicar Eventos.

Para começar a usar o aplicativo é só fazer o download gratuito, utilizar seu CPF e senha fornecida pela Zelle.

Você já está pronto para aproveitar essas e outras vantagens.

Gree + brings you a brand new experience for intelligent control. As a new official application software that Gree  develops specially for IoT era, it has the functions of appliances management, intelligent control, etc., which makes your life much easier.  

Function introductions:
1、Intelligent products can be easily added into Gree ecosystem for intelligent management uniformly;
2、You can control the appliance at anytime and anywhere you like;
3、You can know the status of the appliance in real time and all changes of appliance status will be reported to you immediately。

Astegiudiziarie.it, il primo portale di pubblicità legale in ordine di tempo e di numero di aste pubblicizzate, mediante la propria App permette la consultazione di decine di migliaia di vendite giudiziarie promosse presso i tribunali italiani che usufruiscono dei nostri servizi.

• Ricerca veloce dei beni, con possibilità di applicare i filtri per ubicazione, parole chiave, categoria e fascia di prezzo;
• Ricerca avanzata dei beni filtrando anche per una o più tipologie di bene, tribunale, ruolo della procedura, giudice, professionista, tipo e modalità di vendita, data dell’asta, contenuti multimediali ed altro;
• Ordina gli annunci trovati per data di pubblicazione, data di vendita, prezzo base o ruolo della procedura;
• Consulta e condividi la scheda dettagliata della vendita e le modalità di partecipazione all’asta;
• Consulta, salva e condividi i documenti ufficiali di vendita;
• Sfoglia le fotografie e le planimetrie dei lotti in vendita, visualizza i Virtual Tour 360° ed i video in alta risoluzione, ove disponibili;
• Visualizza sulla mappa il luogo dove si trova l’immobile in vendita ed attiva il sistema di navigazione per farti guidare dalla tua posizione sino all’indirizzo di tuo interesse;
• Registrati e salva nella tua area riservata le aste di tuo interesse e le tue ricerche preferite per ritrovarle quando vuoi;
• Ricevi notifiche push ogni volta che vengono pubblicati nuovi esiti e nuovi esperimenti di vendita relativi ai tuoi beni preferiti;
• Ricevi una mail giornaliera con i nuovi annunci pubblicati che soddisfano i criteri delle tue ricerche preferite;
• Contatta il custode giudiziario telefonicamente o tramite e-mail.

Per qualsiasi segnalazione o richiesta di supporto, contattaci tramite la funzione “Segnala un problema” all’interno dell’App.
